const Project = ({github, projManageLink, image, description, link}) => {
    return ( 
        <div className="max-w-sm w-full flex flex-col gap-y-2 rounded-xl bg-[#30323d] pb-5 m-3">
            <div className="w-full h-[200px] md:h-[300px] flex items-center justify-center mt-3">
                <img className="w-1/2 h-1 object-scale-down" src={image} alt="Project Image" />
            </div>
            <div className="flex h-10 w-full justify-center gap-5 mt-2">
                {github && <button className="bg-white py-1 px-2 rounded-md" onClick={() => window.open(github)}>Code</button>}
                {projManageLink && <button className="bg-white py-1 px-2 rounded-md" onClick={() => window.open(projManageLink)}>Demo</button>}
                {link && <button className="bg-white py-1 px-2 rounded-md" onClick={() => window.open(link)}>Site</button>}
            </div>
            <div className="h-auto text-base p-2 bg-white rounded-lg m-2">
                <p>{description}</p>
            </div>
        </div>
    );
}

export default Project;
